import Feed from "../../components/feed/Feed";
import Rightbar from "../../components/rightbar/Rightbar";
import Topbar from "../../components/topbar/Topbar";
import "./profile.css";

export default function Profile() {
  return (
    <>
      <Topbar />
      <div className="profile">
        {/* <Sidebar /> */}
        <div className="profileRight">
          <div className="prightTop">
            <div className="profileCover">
              <img className="coverImg" src="assets/post/3.jpeg" alt="" />
              <img className="userImg" src="assets/profile/2.jpeg" alt="" />
            </div>
            <div className="profileInfo">
              <h4 className="infoName">Irfan Hamami</h4>
              <span className="infoDesc">hai hai hai ...</span>
            </div>
          </div>
          <div className="prightBot">
            <Feed />
            <Rightbar profile />
          </div>
        </div>
      </div>
    </>
  );
}
